import React from 'react';

function Chefchaouen() {
  return (
    <div className="p-8">
      <h1 className="text-4xl font-bold text-blue-600 mb-4">Chefchaouen</h1>
      <p className="text-lg text-gray-700">Welcome to the Blue Pearl of Morocco...</p>
    </div>
  );
}

export default Chefchaouen;
